return {
	serializeBonusAttributes: function(bA) {
		var result = "";
		if (bA) {
			var sep = "";
			var v;
			for (var att in bA) {
				v = bA[att];
				result += sep + att;
				if (v !== null || v !== undefined) {
					result += "=\"" + bA[att] + "\""
				}
				sep = " ";
			}
		}
		return result;
	}
};
